utils.waitForElement('.notifications-container').then(function(){
  //only run if popular items cookie doesn't exist
  if(document.cookie.indexOf('popular_items_message=') < 0){
    
    utils.waitForElement('.total-price').then(function(){
    var totalPrice = document.querySelector('.total-price').innerHTML;
    //if total price is not 0 (shopping bag is not empty)
    if (!totalPrice.includes(">0.00")){
      
      //target notifications container and insert popular items message   
      node = document.querySelector('.notifications-container');
      node.insertAdjacentHTML('beforeend', '<div id="popular-items_informational_msg">Some of our most popular items can only be saved in your bag for 2 hours.<button class="remove-button" id="popular-items_remove-button" aria-label="dismiss notification"><span class="popular-items_remove-x"></span></button></div>');

      document.getElementById("popular-items_remove-button").addEventListener("click", popular_items_remove);
      var elements = document.getElementsByClassName("remove-button");

      for (var i = 0; i < elements.length; i++) {
          elements[i].addEventListener('click', remove_item_bag, false);
      }
      var elementslater = document.getElementsByClassName("save-for-later-button");

      for (var j = 0; j < elementslater.length; j++) {
          elementslater[j].addEventListener('click', remove_item_bag, false);
      }
    }
    
  });
  }
  
  function remove_item_bag(){
   setTimeout(function(){
     if (utag.o['gapinc.usfactory'].sender[2].data.data.product_quantity == 0){
       document.getElementById("popular-items_informational_msg").remove();
     }
    }, 700);
  }
  
  function checkItemsInBag(){
    utils.waitForElement('.total-price').then(function(){
      var totalPrice = document.querySelector('.total-price').innerHTML;
      if (!totalPrice.includes(">0.00")){
        return true;
      }
    });
     
  }
                                                          
  function popular_items_remove(){
    document.getElementById("popular-items_informational_msg").remove();
    //cookie expire in 30
    var now = new Date();
    now.setTime(now.getTime() + 30 * 60 * 1000);
    document.cookie = "popular_items_message=hidden; expires=" + now.toUTCString() + "; path=/";
  }
  
});
