      // Text to the right of the timer values
      var remainingText = document.createElement("div");
      remainingText.append("left to complete your YEEZY Gap purchase.");

      // Append all children to the parent container
      timerContainer.appendChild(bang);
      timerContainer.appendChild(timerValues);
      timerContainer.appendChild(remainingText);

      // Append the parent container to the DOM
      document.querySelector("h1").after(timerContainer);

      // Start the timer
      var mins = 15;
      var totalSeconds = mins * 60;
      var totalSecondsRemaining = totalSeconds;
      var minsRemaining, secondsRemaining;

