function sendToOmni(eventName) {
  utils.waitUntil(function(){ return window.utag && window.utag.link; }).then(function(){
  	utag.link({"test_coe":eventName, "business_unit_id": 1});
  });
}  
  
var adTemplate = function (placeAfter, index) {
  var adPlacement = document.createElement('div');
  var deviceAdData = adData.mobile;
  
  adPlacement.className = 'dpg-adUnitWrapper dpg-adUnit-' + index;
  adPlacement.innerHTML = deviceAdData.impressionImg + '<a target="_blank" href="' + deviceAdData.href + '" ><img src="' + deviceAdData.src + '" alt="Great minds fly alike. Alaska Airlines" /> </a>';
  adPlacement.addEventListener('click',function () { sendToOmni('click_on_mckinsey_ad_' + index); });
  
  return adPlacement;
};

// window._sendToOmni = sendToOmni;

var insertAdPlacement = function(productCard, ad) {
	productCard.parentNode.parentNode.parentNode.insertBefore(ad, productCard.parentNode.parentNode.nextSibling);
};

function throttleScroll(func, wait) {
  var running = [];
  var time = Date.now();
  return function() {
    if (!running.includes(func)) {
      if ((time + wait - Date.now()) < 0) {
        running.push(func);
        window.requestAnimationFrame(function(){
          func();
          time = Date.now();
          running = running.filter(function(funct){return funct !== func;});
        });
      }
    }
  };
}

var makeChangeOnGrid = function(place, index) {
  return function (throttle) {
  var recList = document.querySelectorAll('.product-card__image-wrapper');
    if(recList[place]) {
      insertAdPlacement(recList[place], adTemplate(place, index));
      sendToOmni('mckinsey_ad_fired_' + index);
      window.removeEventListener("scroll", throttle);
    }
  };
};

var placement = [23];

var run = function (data, index) {
    var changeFunction = makeChangeOnGrid(data, index);
    var throttleFunc = throttleScroll(function() { changeFunction(throttleFunc); }, 750);
    window.addEventListener("scroll", throttleFunc);
    changeFunction(throttleFunc);
};

utils.waitUntil(function () { return document.querySelectorAll('.product-card'); }).then(function () {
  placement.forEach(function(dataObj, index) {
    run(dataObj, index);
  });
});
